import React from 'react';
import { Link } from '@reach/router';

const Card = props => {
    const { pet } = props;

    return (

        <table class="table table-bordered">
            <thead>
                <tr>
                    <th scope="col">Name</th>
                    <th scope="col">Type</th>
                    <th scope="col">Actions</th>
                </tr>
            </thead>

            <tbody>
                <tr>
                    <td>{pet.petName}</td>
                    <td>{pet.type}</td>
                    <td>Details | Edit</td>
                </tr>
            </tbody>
        </table>

    )
}

export default Card;
